import React from 'react';
import './App.css';
import {Todolist} from "./Components/Todolist";

function App() {

    const title = 'What to learn-1';

    return (
        <div className="App">
            <Todolist title={"What to learn-1"} title2={100200}/>
            <Todolist title={"What to learn-2"} title3={true}/>
        </div>
    );
}

export default App;
